import React from "react";
import classes from "./Header.module.css";
import { TbUserCircle } from "react-icons/tb";

const Header = (props) => {
  return (
    <div>
      <header className={classes.header}>
        <div className={classes.containLeft}>
          <h1 className={classes.brandName}>TaskPlanr</h1>
          <span className={classes.navlist}>
            <span className={classes.navItem}>
              <a href="">Home</a>
            </span>
            <span>
              <a href="">Tasks</a>
            </span>
            <span>
              <a href="">Contact</a>
            </span>
            <span>
              <a href="">FAQs</a>
            </span>
          </span>
        </div>
        <span className={classes.user}>
          <a href="">Thomas Parker</a>
          <TbUserCircle className={classes.usericon}></TbUserCircle>
        </span>
      </header>
    </div>
  );
};

export default Header;
